import React from 'react';
import logo from './logo.svg';
import './App.css';

const codeBlocks = require('json!./codeBlocks.json');

import CodeGenerator from './components/code-block/codeGenerator.component';

function App() {
  return (
    <div className="App">
      <CodeGenerator codeBlocks={codeBlocks} />
    </div>
  );
}

export default App;
